from itertools import count, islice
def agen(): # generator of terms
    num, den, pow = 0, 1, 0
    for n in count(1):
        sn = str(n)
        num = num*10**len(sn) + n
        den *= 10**len(sn)
        pow += len(sn)
        nr, dr, c2, c5 = num, den, pow, pow
        while nr%2 == 0 and c2 > 0: nr //= 2; dr //= 2; c2 -= 1
        while nr%5 == 0 and c5 > 0: nr //= 5; dr //= 5; c5 -= 1
        yield dr
